import Item from "../item/Item";
import "../card.css"
const Card = () => {
  return (
    <div className="cards-area-container">
      {/* <div></div> */}
      <h1 className="language-title">Languages</h1>

      <div>
      {languages.map((item, index) => {
        return (

            <Item card={item} key={index} />

        );
      })}
       </div>
    </div>
  );
};

export default Card;
